import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from "./components/Header";
import Home from "./components/Home";
import Footer from "./components/Footer";
import EventDetailes from "./components/EventDetailes";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <Routes>
        <Route path="/" element={<Home />} forceRefresh={true} />
        <Route path="/detailes" element={<EventDetailes/>} forceRefresh={true} />
        <Route path="/detailes" element={<Even/>} forceRefresh={true} />
        </Routes>
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
